script: |
  super -f tsv -I q4293.sql | sort > q4293.out

vector: true

inputs:
  - name: q4293.sql
    data: |
      pragma pg
      SELECT DISTINCT - - col2 AS col2 FROM tab2 WHERE NOT + col0 IS NOT NULL GROUP BY col0, col2 HAVING NOT - NULLIF ( + NULLIF ( col2, - col2 ), col0 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q4293.out
    data: |
